window.bookSummaryJSON = "<p>A mission to free a world from the Kleese has gone terribly wrong. Lieutenant Ryan Nelson and his Marines are trapped with no hope of rescue. </p> <p>On the Kleese home world, a division grows between the regular Kleese and the militaristic Zaltule. </p> <p>The war against the Kleese intensifies as the human-led Alliance attempts a daring attack against the heart of the Kleese Empire. If the mission succeeds, it will be a great victory for the Alliance. If it fails, it will mean the end of freedom for all the races of the galaxy and the end of human life. </p>"; 
